function specialPerm(nums: number[]): number {
  const n = nums.length;
  const mod = 1e9 + 7;
  nums.sort((a, b) => a - b);

  const dp = Array.from({ length: 1 << n }, () => 0);
  dp[0] = 1;

  for (let mask = 1; mask < (1 << n); ++mask) {
    for (let i = 0; i < n; ++i) {
      if ((mask & (1 << i)) === 0) continue;
      if (mask === (1 << i)) {
        dp[mask] = 1;
        continue;
      }
      for (let j = 0; j < n; ++j) {
        if ((mask & (1 << j)) === 0 || i === j) continue;
        if (nums[i] % nums[j] === 0 || nums[j] % nums[i] === 0) {
          dp[mask] = (dp[mask] + dp[mask ^ (1 << i)]) % mod;
        }
      }
    }
  }

  return dp[(1 << n) - 1];
}
